import React, {Component} from 'react'
import logo from './logo-sk.png'
import './Login.css'

export default class Login extends Component {

    state = {
        result: null
    };

    onLoginSubmit() {
        let result = fetch('/users', {
            crossDomain:true, 
            method: "GET",
            headers: {
                Accept: "application/json",
                "Content-Type": "application/json"
            }
        })
            .then((resp) =>{
            console.log(resp)
        })
    }

    render() {
        return(
            <div className="login">
                <div className="login-triangle"></div>

                <p className="login-header"><strong>S</strong>kelters</p>

                <form className="login-container" onSubmit={this.onLoginSubmit.bind(this)}>
                    <p><input name="email" type="text" placeholder="Email" ref="email"/></p>
                    <p><input name="password" type="password" placeholder="Password" ref="password"/></p>
                    <p><input type="submit" value="LOGIN"/></p>
                </form>
            </div>
        );
    }
}
